import React from "react";
import { Nav, Dropdown } from "rsuite";

const EditorMenu = () => {
  const themes = [
    "monokai",
    "github",
    "tomorrow",
    "kuroir",
    "twilight",
    "xcode",
    "textmate",
    "solarized dark",
    "solarized light",
    "terminal",
  ];

  const modes = [
      "javascript",
      "java",
      "python",
      "xml",
      "ruby",
      "sass",
      "markdown",
      "mysql",
      "json",
      "html",
      "handlebars",
      "golang",
      "csharp",
      "coffee",
      "css"
  ]
  return (
    <div
      style={{
        display: "flex",
        flexFlow: "row",
        justifyContent: "space-between",
        marginTop: "0.5rem",
        marginBottom: "0.5rem"
      }}
    >
      <Nav>
          <Nav.Item>+ Set Snippet</Nav.Item>
      </Nav>
      <Nav>
        <Dropdown title="Themes">
          {themes.map((theme) => (
            <Dropdown.Item>{theme}</Dropdown.Item>
          ))}
        </Dropdown>
        <Dropdown title="Editor Mode">
            {modes.map((mode)=>(
                <Dropdown.Item>{mode}</Dropdown.Item>
            ))}
        </Dropdown>
      </Nav>
    </div>
  );
};

export default EditorMenu;
